import React from 'react'

export default function FinishScreen({points,maxPoints}) {
    const percentage = (points/maxPoints) * 100;
  return (
    <div>
        <p>
            You scored <strong>{points}</strong> out of {maxPoints} (
                {maxPoints.ceil(percentage)})
        </p>
    </div>
  )
}
